import axios from "axios";
import React from "react";

import { Link, useParams } from "react-router-dom";

function QuestionContainer() {
    const { id } = useParams();
    const QUIZ_API_BASE_URL = "http://localhost:8080/api/quiz/" + `${id}` + "/question";

    const [post, setPost] = React.useState(null);

    React.useEffect(() => {
        axios.get(QUIZ_API_BASE_URL).then((response) => {
            setPost(response.data);
            console.log(response.data);
        });
    }, []);

    return (
        <div className="container">
            <Link to="/"><button className="termMenu">Główna</button></Link>
            <Link to="/quiz"><button className="termMenu">Quiz</button></Link>
            <button className="termMenu">Forum</button>
        </div>
    );
}

export default QuestionContainer
